package user89.pojo;

public class MyLetsMeet {
	
	String mmeetid;
	String mname;
	String mlocationcity;
	String mlocationaddress;
	String mcategory;
	String mdescription;
	String mstartdate;
	String mstarttime;
	String menddate;
	String mendtime;
	String name;
	
	
	public MyLetsMeet() {
		// TODO Auto-generated constructor stub
	}
	
	
	


	public MyLetsMeet(String mmeetid, String mname, String mlocationcity, String mlocationaddress, String mcategory,
			String mdescription, String mstartdate, String mstarttime, String menddate, String mendtime, String name) {
		super();
		this.mmeetid = mmeetid;
		this.mname = mname;
		this.mlocationcity = mlocationcity;
		this.mlocationaddress = mlocationaddress;
		this.mcategory = mcategory;
		this.mdescription = mdescription;
		this.mstartdate = mstartdate;
		this.mstarttime = mstarttime;
		this.menddate = menddate;
		this.mendtime = mendtime;
		this.name = name;
	}





	public String getName() {
		return name;
	}





	public void setName(String name) {
		this.name = name;
	}





	public String getMmeetid() {
		return mmeetid;
	}
	public void setMmeetid(String mmeetid) {
		this.mmeetid = mmeetid;
	}
	public String getMname() {
		return mname;
	}
	public void setMname(String mname) {
		this.mname = mname;
	}
	public String getMlocationcity() {
		return mlocationcity;
	}
	public void setMlocationcity(String mlocationcity) {
		this.mlocationcity = mlocationcity;
	}
	public String getMlocationaddress() {
		return mlocationaddress;
	}
	public void setMlocationaddress(String mlocationaddress) {
		this.mlocationaddress = mlocationaddress;
	}
	public String getMcategory() {
		return mcategory;
	}
	public void setMcategory(String mcategory) {
		this.mcategory = mcategory;
	}
	public String getMdescription() {
		return mdescription;
	}
	public void setMdescription(String mdescription) {
		this.mdescription = mdescription;
	}
	public String getMstartdate() {
		return mstartdate;
	}
	public void setMstartdate(String mstartdate) {
		this.mstartdate = mstartdate;
	}
	public String getMstarttime() {
		return mstarttime;
	}
	public void setMstarttime(String mstarttime) {
		this.mstarttime = mstarttime;
	}
	public String getMenddate() {
		return menddate;
	}
	public void setMenddate(String menddate) {
		this.menddate = menddate;
	}
	public String getMendtime() {
		return mendtime;
	}
	public void setMendtime(String mendtime) {
		this.mendtime = mendtime;
	}

}
